import React from 'react';
import Header from './Header';
import Sidebar from './Sidebar';
import Feed from './Feed';
import Widgets from './Widgets';
import './App.css';

function App() {
  return (
    <div className='App'>
      {/* header */}
      <Header />

      <div className='app__body'>
        {/* left sidebar */}
        <Sidebar />

        {/* main feed */}
        <Feed />

        {/* right section */}
        <Widgets />
      </div>
    </div>
  );
}

export default App;
